import React from 'react';
import InputItem from '../../components/InputItem';

const Register = () => {
    return (
        <div>
            <InputItem 
                name="mail"
                placeholder="mailbox" 
                size="large"
                rules={[
                    {
                        required: true,
                        message: "Please input mail!"
                    },
                    {
                        type: 'email',
                        message: 'Please input mail with right format!'
                    },
                ]}
            />
        </div>
    )
};

export default Register;
